actionConfiguration.body:
() => {
		if (GetStocktakeComparisons.data == null) {
			let ret = []
			return ret
		}
		var ret = []
		for (let i = 0; i < GetStocktakeComparisons.data.data.getStoctakeActualComparison.serialised.erroredSubLots.length ; i ++) {
			let line = GetStocktakeComparisons.data.data.getStoctakeActualComparison.serialised.erroredSubLots[i]

			let expectedOwner = ""
			let countedOwner = ""

			if (line.expectedOwner.companyCode != null) {
				expectedOwner = line.expectedOwner.companyCode
			}
			if (line.countedOwner.companyCode != null) {
				countedOwner = line.countedOwner.companyCode
			}

			let row = {
				"SerialNumber": line.subLot.code,
				"Material": line.material.code,
				"Error": line.error,
				"ExpectedLocation": line.expectedLocation.name,
				"ExpectedCarrier": line.expectedCarrier.code,
				"ExpectedStatus": line.expectedStatus.code,
				"CountedStatus": line.countedStatus.code,
				"ExpectedOwner": expectedOwner,
				"CountedOwner": countedOwner,
			}
			ret.push(row)
		}
		storeValue("erroredSerialsTable", ret)
		return ret
	}

